import Landing from '../components/layouts/landing'

import {
  Layout as LayoutIcon
} from "react-feather"

const landingRoutes = {
  path: "/",
  name: "Landing Page",
  component: Landing,
  children: null
}

export const landing = [landingRoutes]

export default [
  landingRoutes
]
